import React from "react";
import styled from "styled-components";

export default function post() {
  return (
    <Container>
      <Nav>
        <img className="arrow" src={"./arrow-left.svg"} alt="back-arrow"></img>
        <div className="arrow-explain">글 목록으로</div>
      </Nav>
    </Container>
  );
}
const Container = styled.div`
  display: flex;
  position: relative;
  flex-direction: column;
  border: solid grey 1px;
  border-radius: 10px;
  width: 360px;
  height: 821px;
`;
const Nav = styled.div`
  display: flex;
  flex-direction: row;
  .arrow {
    width: 20px;
    height: 20px;
    margin: 5px 10px;
  }
  .arrow-explain {
    font-size: 20px;
    font-weight: 700;
    line-height: 20px;
    color: #b4b4b4;
  }
`;
